import React from "react";
import { useQuery } from "@tanstack/react-query";

const fetchUsers = async (): Promise<RQUser[]> => {
  const res = await fetch("https://jsonplaceholder.typicode.com/users");
  if (!res.ok) throw new Error("Network error");
  return res.json();
};

const BasicQueryDemo: React.FC = () => {
  const { data, isLoading, isError, error, refetch, isFetching } = useQuery({
    queryKey: ["users"],
    queryFn: fetchUsers,
    staleTime: 30_000,
  });

  return (
    <div className="space-y-3">
      <div className="flex items-center gap-2">
        <button
          className="px-3 py-1 rounded text-sm bg-indigo-500 text-white hover:bg-indigo-600"
          onClick={() => refetch()}
        >
          重新获取
        </button>
        {isFetching && <span className="text-xs text-gray-500">获取中…</span>}
      </div>
      {isLoading && <div className="text-xs text-gray-500">加载中…</div>}
      {isError && (
        <div className="text-xs text-red-600">
          错误：{(error as Error).message}
        </div>
      )}
      {data && (
        <div className="h-48 overflow-auto border rounded p-2 bg-white text-xs text-gray-700">
          {data.map((u) => (
            <div key={u.id}>
              {u.id}. {u.name}
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default BasicQueryDemo;
